const users = (state = [], action) => {
    switch (action.type) {
        case 'FETCH_USERS':
            return action.payload;

        case 'ADD_NEW_USER':
            return [
                ...state,
                {
                    bloodType: '',
                    chatroom: [],
                    dateOfBirth: '',
                    lastDonatedDate: '',
                    location: '',
                    phone: '',
                    uid: '',
                    username: action.user.username,
                    weight: ''
                }
            ]
        default: 
            return state
    }
}

export default users;
